import { useSearchParams } from "react-router-dom";
import { Container, SubText, TextContainer, Title } from "./styles";

export default function PropertyDetails() {
  const [searchParams] = useSearchParams();

  const image = searchParams.get("externalId");
  const rentFrequency = searchParams.get("externalId");
  const price = searchParams.get("externalId");
  const rooms = searchParams.get("externalId");
  const baths = searchParams.get("baths");
  const id = searchParams.get(":id");
  return (
    <Container>
      <Title>PropertyDetails {id}</Title>
      <TextContainer>
        <SubText>{id}</SubText>
        <SubText>{rentFrequency}</SubText>
        <SubText>{rooms}</SubText>
        <SubText>{baths}</SubText>
      </TextContainer>
    </Container>
  );
}
